import './App.css';
import React, { useState, useEffect } from 'react';
import client from './axiosConfig';
import Container from 'react-bootstrap/Container';
import Navbar from 'react-bootstrap/Navbar';
import Button from 'react-bootstrap/Button';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faSearch } from '@fortawesome/free-solid-svg-icons';
import { BrowserRouter as Router, Route, Routes, Link } from 'react-router-dom';
import Lottie from 'lottie-react';
import animationData from './assets/media/animation/main.json';
import secondAnimation from './assets/media/animation/Animation - 1721222788256.json';

/* Components */
import Features from './components/Features';
import Contact from './components/Contact';
import Register from './components/Register';
import Login from './components/Login';
import Menu from './components/Menu';

function App({ setCurrentUser }) {
  const [currentUser, setCurrentUserState] = useState(false);

  useEffect(() => {
    client.get("/api/user")
      .then(res => {
        setCurrentUserState(true);
      })
      .catch(error => {
        console.error('Error fetching user', error);
        setCurrentUserState(false);
      });
  }, []);

  function submitLogout(e) {
    e.preventDefault();
    client.post("/api/logout", {}, { withCredentials: true })
      .then(res => {
        setCurrentUserState(false);
        setCurrentUser(false);
      });
  }

  if (currentUser) {
    return (
      <div className='header'>
        <Navbar className='navbar-custom'>
          <Container>
            <Navbar.Brand>You are now logged in</Navbar.Brand>
            <Navbar.Toggle />
            <Navbar.Collapse className="justify-content-end">
              <Navbar.Text>
                <Button className='logout-button' onClick={submitLogout} variant="light">Log out</Button>
              </Navbar.Text>
            </Navbar.Collapse>
          </Container>
        </Navbar>
        <div className="button-container">
          <button className="button support">Support</button>
          <button className="button community">Community</button>
          <Link to="/features" className="button features">Features</Link>
          <Link to="/contact" className="button contact-us">Contact Us</Link>
          <button className="button language">English</button>
          <button className="button search-button">
            <FontAwesomeIcon icon={faSearch} />
          </button>
          <button className="button logout" onClick={submitLogout}>Log out</button>
        </div>
        <Menu />
        <div className="home">
          <img src="/media/pexels-googledeepmind-17485633.jpg" alt="Sample" />
        </div>
      </div>
    );
  }

  return (
    <div className="main-page">
      <div className='animation-container'>
        <Lottie className='animation'
          animationData={secondAnimation} 
          loop={true} 
          autoplay={true} 
           />
           <div className='animation-container-text'>
            <h1><b>Enhance Your<br/> Analytics with AI</b></h1>
           </div>
          </div>
      <Menu />
    </div>
  );
}

function RoutesConfig() {
  const [currentUser, setCurrentUser] = useState(false);

  return (
    <Router>
      <Routes>
        <Route path="/" element={<App setCurrentUser={setCurrentUser} />} />
        <Route path="/register" element={<Register setCurrentUser={setCurrentUser} />} />
        <Route path="/login" element={<Login setCurrentUser={setCurrentUser} />} />
        <Route path="/features" element={<Features />} />
        <Route path="/contact" element={<Contact />} />
      </Routes>
    </Router>
  );
}

export default RoutesConfig;
